import { connect } from "react-redux"

const LeaderBoard = () => {
    const data = [
        { id: 1, name: 'John Doe', age: 25, email: 'john.doe@example.com' },
        { id: 2, name: 'Jane Smith', age: 30, email: 'jane.smith@example.com' },
        { id: 3, name: 'Peter Jones', age: 35, email: 'peter.jones@example.com' },
      ];

      return (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Answer</th>
              <th>Poll</th>
            </tr>
          </thead>
          <tbody>
            {data.map(row => (
              <tr key={row.id}>
                <td>{row.id}</td>
                <td>{row.name}</td>
                <td>{row.age}</td>
                <td>{row.email}</td>
              </tr>
            ))}
          </tbody>
        </table>
      );
    }
export default connect()(LeaderBoard)
